import { Fragment, useContext } from 'react';
import { Route, Switch, Redirect } from 'react-router-dom';

import Contacts from './Pages/Contacts';
import Home from './Pages/Home';
import LeadsModule from './Pages/Leads';
import SignIn from './Pages/Signin';
import Signup from './Pages/Signup';
import AuthContext from './Store/AuthContext';
import SignUpContextProvder from './Store/signUpContext';


function App() {

  const { isLoggedIn} = useContext(AuthContext);

  return (
      <Fragment>
        <Switch>
          <Route path="/" exact component={SignIn}/>
          <Route path="/signup">
           <SignUpContextProvder> <Signup/></SignUpContextProvder>
          </Route>
          <Route path="/home/org/:orgId"> { isLoggedIn ? <Home/> : <Redirect to="/"/>}</Route>
          <Route path="/leads/org/:orgId"> { isLoggedIn ? <LeadsModule/>: <Redirect to="/"/> }</Route>
          <Route path="/contacts/org/:orgId"> { isLoggedIn ? <Contacts/>: <Redirect to="/"/> } </Route>
         { !isLoggedIn && <Route path="*" render={()=> <Redirect to="/"/>}/> }
        </Switch>
      </Fragment>
  );
}

export default App;
